import React from 'react';
import '../../style/background.css';

const Background = props => (
    <>
        <div className = "background" id = {props.backgroundColor}>
            <div id = {props.blob1}></div>
            <div id = {props.blob2}></div>
            <div id = {props.blob3}></div>
        </div>
    </>
);

export default Background;
